import React from "react";
import classes from './Cart.module.css'

function Cart() {
  const cartItems =<ul className={classes['cart-items']}>{[{
    id: "m1",
    name: "Sushi",
    amount: 2,
    price: 22.99,
  }].map((item) => <li>{item.name}</li>)}</ul>
  return <div>{cartItems}
  <div>
    <span>Total Amount</span>
    <span>35.62</span></div></div>;
}

export default Cart;
